const labelEffects = (inputName, labelName, inputGroupName)=>{
	$(`.${inputName}`).on('focus', function() {
        $(`.${labelName}`).removeClass(`${labelName}_active`);
        $(`.${inputGroupName}`).removeClass(`${inputGroupName}_active`);
		$(this).siblings(`.${labelName}`).addClass(`${labelName}_active`);
        $(this).parent().addClass(`${inputGroupName}_active`);
    });
    $(`.${inputName}`).on('focusout', function() {
		$(`.${labelName}`).removeClass(`${labelName}_active`);
        $(`.${inputGroupName}`).removeClass(`${inputGroupName}_active`);
    });
}

labelEffects('footer-subscribe-form__input', 'footer-subscribe-form__label', 'footer-subscribe-form__input-group');
labelEffects('modal-form__input', 'modal-form__label', 'modal-form__input-group');

class showModalCallback extends showModal {
	constructor(props) {
		super(props);
		this.beforeOpen = props.beforeOpen;

	}
	open() {
		this.beforeOpen(this)
		$(this.popup).css("display", "flex").hide().fadeToggle();
		this.status = true;
		
	};
}









let stageModalIsOpen = false;
const $modal = $('.js-menu');





function openStageModal() {
	$modal.css("display", "flex").hide().fadeToggle();
	stageModalIsOpen = true;
};

function closeStageModal() {
	$modal.fadeOut(300);
	stageModalIsOpen = false;
	
};

function toggleStageModal() {
	if (stageModalIsOpen) {
		$body.removeClass('modal-active');
		closeStageModal();
	} else {
		$body.addClass('modal-active');
		openStageModal();
	}
}

$body.on('click', '.js-header-menu-btn, .js-menu-btn-close', function () {
	toggleStageModal();
});


